const long long MOD = 1e9 + 7;
const long long MAXN = 1e6 + 1;
using namespace std;

typedef long long ll;

long long readInt() {
    bool minus1 = false;
    long long result = 0;
    char ch;
    ch = getchar();
    while (true) {
        if (ch == '-') break;
        if (ch >= '0' && ch <= '9') break;
        ch = getchar();
    }
    if (ch == '-') minus1 = true; else result = ch-'0';
    while (true) {
        ch = getchar();
        if (ch < '0' || ch > '9') break;
        result = result*10 + (ch - '0');
    }
    if (minus1)
        return -result;
    else
        return result;
}

const int N = 20;

int dp[(1 << N)];
int mn[(1 << N)];
int used[N][N];

bool bit(int x, int i) {
	return (x >> i) & 1;
}

int main() {

	assert(freopen("headmasters.in", "r", stdin));
    assert(freopen("headmasters.out", "w", stdout));
    int n = readInt(), m = readInt();
    for (int i = 0; i < m; i++) {
		int tmp1 = readInt() - 1, tmp2 = readInt() - 1;    
    	used[tmp1][tmp2] = 1;
    	used[tmp2][tmp1] = 1;
    }
	for (int i = 1; i < (1 << n); i++) {
		dp[i] = MOD;
	}
	for (int mask = 0; mask < (1 << n); mask++) {
		for (int i = 0; i < n; i++) {
			if (bit(mask, i)) continue;
			int new_mask = mask | (1 << i);
	        mn[new_mask] = mn[mask];
			for (int j = 0; j < n; j++) {
				if (i == j) continue;
				if (!used[i][j]) continue;
				mn[new_mask] += (bit(mask, j) ? -1 : +1);
			}
			dp[new_mask] = min(dp[new_mask], dp[mask] + mn[mask]);
		}
	}
    cout << dp[(1 << n) - 1];
    return 0;
}